import React, { useEffect, useState } from 'react'
import axios from 'axios'

const DeleteEquity = () => {
    const [id, setId] = useState()

    useEffect(() => {
        axios.get(``)
            .then()
            .catch()
    })

    const deleteBtnHandler = () => {
        axios.delete(`https://localhost:7126/api/Equities/Delete/${id}`)
            .then(res => {
                console.log(res)
            })
            .catch(err => {
                console.log(err)
            })
    }

  return (
    <div>
        <h2>Delete Equity</h2>
        <form onSubmit={deleteBtnHandler}>
            <label>Enter SecurityID: </label>
            <input type='text' value={id} placeholder='Enter SecurityID'></input>
            <button type='submit'>Search</button>
        </form>
    </div>
  )
}

export default DeleteEquity
